import React, { useEffect, useState } from 'react';
import axios from 'axios';

export const Orderpage = () => {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const id = localStorage.getItem('supplierId');
    
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:9093/bookingdata', {
          params: {
            supplierid: id
          }
        });
        if (response.status === 200) {
          setData(response.data);
          console.log(response.data); // Log the data received
        }
      } catch (error) {
        console.error("Error fetching data:", error);
        setError("Failed to load data");
      } finally {
        setLoading(false);
      }
    };
    
    fetchData();
  }, []); // Empty dependency array means this effect runs once on mount

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  return (
    <div>
      
      
       
          <ul>
            {data.map((order, index) => (
              <li key={index}>
                <strong>Customer Name:</strong> {order.username}<br />
                <strong>Bike Name:</strong> {order.bikename}<br />
                <strong>Total Price:</strong> {order.totalprice}
              </li>
            ))}
          </ul>

      
    </div>
  );
};
